import React, {useState} from 'react';
import { IonContent, IonButton, IonHeader, IonPage, IonTitle, IonToolbar, IonList, IonItem, IonLabel, IonGrid, IonCol, IonRow, IonAvatar, IonIcon, IonText, IonThumbnail, IonSelectOption, IonSelect, IonDatetime, IonToggle, IonInput, IonCheckbox, IonRange, IonNote, IonItemDivider } from '@ionic/react';
import HateCommentsContainer from '../components/HateCommentsContainer';
import { closeCircle, home, star, navigate, informationCircle, checkmarkCircle, shuffle } from 'ionicons/icons';

import './Tab2.css';

const Tab2: React.FC = () => {
  const [keyword, setKeyword] = useState<string>();

  return (
    <IonPage>
      <IonHeader>
        <IonToolbar>
          <IonTitle>Tab 3</IonTitle>
        </IonToolbar>
      </IonHeader>
      <IonContent fullscreen>
        <IonHeader collapse="condense">
          <IonToolbar>
            <IonTitle size="large">Tab 3</IonTitle>
          </IonToolbar>
        </IonHeader>
        <IonItemDivider>Input with clear button when there is a value</IonItemDivider>
          <IonItem>
            <IonInput value={keyword} placeholder="Enter Input" onIonChange={e => setKeyword(e.detail.value!)} clearInput></IonInput>
          </IonItem>
        <HateCommentsContainer keyword="이효리" />
      </IonContent>
    </IonPage>
  );
};

export default Tab2;
